component.html.body:
Component localeYou can translate component based.The below locale setting example:var locales = {
  en: {
    message: {
      hello: 'hello world'
    }
  },
  ja: {
    message: {
      hello: 'こんにちは、世界'
    }
  }
}

Vue.config.lang = 'ja'
Object.keys(locales).forEach(function (lang) {
  Vue.locale(lang, locales[lang])
})

new Vue({
  el: '#app',
  components: {
    component1: {
      template: 'component1 local: {{ $t("hello") }}'
        + 'component1 global: {{ $t("message.hello") }}',
      locales: {
        en: { hello: 'hello component1' },
        ja: { hello: 'こんにちは、component1' }
      }
    }
  }
})
Template the following:
  {{ $t('message.hello') }}


Output the following:
  こんにちは、世界
  component1 local: こんにちは、component1
  component1 global: こんにちは、世界

 If you set the locale of same keypath as global locale (Vue.locale()), in its component, $t is translate with component locale.

dynamic.html.body:
Dynamic localeSometimes, you need to set dynamically the locale from external location. You can set dynamically it with Vue.locale.the below the example:var self = this
var lang = 'ja'
Vue.locale(lang, function () {
  self.loading = true
  return fetch('/locale/' + lang, {
    method: 'get',
    headers: {
      'Accept': 'application/json',
      'Content-Type': 'application/json'
    }
  }).then(function (res) {
    return res.json()
  }).then(function (json) {
    self.loading = false
    if (Object.keys(json).length === 0) {
      return Promise.reject(new Error('locale empty !!'))
    } else {
      return Promise.resolve(json)
    }
  }).catch(function (error) {
    self.error = error.message
    return Promise.reject()
  })
}, function () {
  Vue.config.lang = lang
})
Dynamic locale interfacesIn dynamic locales, You can use the two type interfaces:1. functionYou need to implement locale setting that return function have function (resolve, reject) like promise (future). The following, those argument of the function, if successful, you need to use the resolve according to locale object. if failed, you need to use rejectsuccessful: resolve

failed: reject

2. promiseAs mentioned above, You need to implement locale setting that return a promise. if successful, you need to resolve according to locale object. if failed, you need to use reject. You must return a ES6 compatible promise.
